package ru.rita.simple.java.hashtable;

import junit.framework.TestCase;

import java.util.Collections;
import java.util.List;

public class AllAnagramsInStringTest extends TestCase {

    public void testFindAnagrams_when_someAnagrams() {
        AllAnagramsInString finder = new AllAnagramsInString();
        var s = "cbaebabacd";
        var p = "abc";
        List<Integer> expected = List.of(0, 6);
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_allAnagrams() {
        AllAnagramsInString finder = new AllAnagramsInString();
        var s = "abab";
        var p = "ab";
        List<Integer> expected = List.of(0, 1, 2);
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_bothAreNull() {
        AllAnagramsInString finder = new AllAnagramsInString();
        String s = null;
        String p = null;
        List<Integer> expected = Collections.emptyList();
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_S_IsNull() {
        AllAnagramsInString finder = new AllAnagramsInString();
        String s = null;
        String p = "null";
        List<Integer> expected = Collections.emptyList();
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_P_IsNull() {
        AllAnagramsInString finder = new AllAnagramsInString();
        String s = "null";
        String p = null;
        List<Integer> expected = Collections.emptyList();
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_bothAreEmpty() {
        AllAnagramsInString finder = new AllAnagramsInString();
        String s = "";
        String p = "";
        List<Integer> expected = Collections.emptyList();
        assertEquals(expected, finder.findAnagrams(s, p));
    }

    public void testFindAnagrams_when_onlyOneChar() {
        AllAnagramsInString finder = new AllAnagramsInString();
        String s = "";
        String p = "";
        List<Integer> expected = List.of(0, 10001);
        assertEquals(expected, finder.findAnagrams(s, p));
    }

}